    'help.AsABuyerHowDoIContactASeller_content': '\u5728\u5EE3\u544A\u5167\u9EDE\u64CA"\u56DE\u8986\u5EE3\u544A"\u7684\u6309\u9215. \u5728\u55AE\u4E0A\u586B\u5165\u60A8\u7684\u806F\u7E6B\u4FE1\u606F\u5305\u62EC\u60A8\u7684\u96FB\u5B50\u90F5\u7BB1\u5730\u5740\u4EE5\u53CA\u60A8\u60F3\u8981\u5BEB\u7684\u5167\u5BB9\uFF0C\u7136\u5F8C\u9EDE\u64CA"\u905E\u4EA4".',
