    'help.WhatKindOfPostingsAreForbiddenNotAllowedOnBrand_content': 'OLX\u7981\u6B62\u520A\u767B\u6216\u552E\u8CE3\u4EFB\u4F55\u9055\u80CC\u4EFB\u4F55\u7576\u5730,\u7701,\u5340\u57DF,\u570B\u5167\u6216\u570B\u969B\u9069\u7576\u7684\u6CD5\u5F8B,\u6CD5\u898F,\u6CD5\u4EE4\u6216\u7AE0\u7A0B\u7684\u5546\u54C1. \u4EE5\u4E0B\u6240\u5217\u662F\u7981\u6B62\u520A\u767B\u5728OLX \u7DB2\u7AD9\u4E0A\u7684: \u4EFB\u4F55\u9023\u9396\u5546\u5E97, \u91D1\u5B57\u5854, \u201C\u4FF1\u6A02\u90E8\u6703\u54E1\u8CC7\u683C\u201D, \u591A\u7D1A\u5E02\u5834\u71DF\u92B7, \u5206\u92B7\u5546\u7279\u8A31\u6B0A\u6216\u92B7\u552E\u4EE3\u8868\u7684\u5B89\u6392\u6216\u5176\u4ED6\u8981\u6C42\u63D0\u524D\u5206\u671F\u4ED8\u6B3E,\u8981\u6C42\u62DB\u652C\u65B0\u6210\u54E1,\u6B21\u7D1A\u5206\u92B7\u5546\u6216\u6B21\u7D1A\u4EE3\u8868,\u6216\u53EA\u767C\u653E\u63D0\u6210(\u9664\u4E86\u6E05\u695A\u520A\u767B\u63D0\u4F9B\u7684\u8077\u4F4D\u53EA\u7D66\u63D0\u6210\u800C\u4E14\u6E05\u695A\u63CF\u8FF0\u5FB5\u6C42\u7684\u4EBA\u5C07\u8CE3\u7684\u7522\u54C1\u6216\u670D\u52D9,\u9019\u985E\u7684\u520A\u767B\u662F\u5141\u8A31\u7684)\u7684\u5546\u696D\u6A5F\u6703.<br>\u5176\u4ED6\u660E\u78BA\u7981\u6B62\u7684\u7269\u54C1\u5305\u62EC: <br /><ul>  <li>\u9152\u985E\u98F2\u6599 </li>  <li>\u8840, \u5206\u6CCC\u7269\u53CA\u8EAB\u9AD4\u5C40\u90E8</li>  <li>\u5077\u7ACA\u5668\u5177 </li>  <li>\u4EFF\u9020\u7684\u7D19\u5E63,\u5370\u7AE0\u6216\u9322\u5E63 </li>  <li>\u4EFF\u9020\u7684\u5546\u54C1 </li>  <li>\u96FB\u5B50\u76E3\u8996\u5668\u6750 </li>  <li>\u7981\u904B\u7269\u54C1  </li>  <li>\u653F\u5E9C\u53CA\u4EA4\u901A\u904B\u8F38\u55AE\u4F4D\u7684\u5236\u670D, \u8EAB\u4EFD\u8B49\u53CA\u57F7\u7167 </li>  <li>\u9055\u6CD5\u6BD2\u54C1 \u548C\u85E5\u7269\u8A2D\u5099 </li>  <li>\u5404\u5F0F\u5404\u6A23\u7684\u9055\u6CD5\u670D\u52D9\u53CA\u5546\u54C1. </li>  <li>\u5371\u96AA\u7269\u6599 </li>  <li>\u7159\u706B,\u7834\u58DE\u6027\u7684\u8A2D\u5099\u548C\u70B8\u85E5</li>  <li>\u8EAB\u4EFD\u8B49,\u500B\u4EBA\u8CA1\u52D9\u8A18\u9304\u548C\u500B\u4EBA\u8CC7\u6599(\u4EFB\u4F55\u578B\u5F0F, \u5305\u62EC\u96FB\u5B50\u90F5\u4EF6\u540D\u55AE) </li>  <li>\u9F13\u52F5\u6216\u4FC3\u9032\u9055\u6CD5\u884C\u70BA\u7684\u7269\u54C1 </li>  <li>\u5F69\u7968, \u514C\u734E\u5361\u548C\u8001\u864E\u6A5F </li>  <li>\u6DEB\u7A62\u6750\u6599\u548C\u5404\u6A23\u7684\u8272\u60C5\u7269 </li>  <li>\u6240\u6709\u6709\u4FAE\u8FB1\u578B\u5F0F\u7684\u6750\u6599 </li>  <li>\u6BBA\u87F2\u5291 </li>  <li>\u542B\u524D\u8EAB\u88F8\u9AD4\u5716\u7247\u6216\u5F71\u7247</li>  <li>\u8B66\u5BDF\u548C\u5176\u4ED6\u8B66\u885B\u7684\u8B58\u5225\u8B49\u548C\u5236\u670D</li>  <li>\u8655\u65B9\u85E5\u7269\u548C\u8A2D\u5099 </li>  <li>\u88AB\u53EC\u56DE\u7684\u7269\u54C1 </li>  <li>\u80A1\u7968\u4EE5\u53CA\u5176\u4ED6\u8A3C\u5377 </li>  <li>\u5077\u7ACA\u7269 </li>  <li>\u7159\u8349\u88FD\u54C1 </li>  <li>\u7528\u904E\u7684\u5316\u599D\u54C1 </li>  <li>\u6B66\u5668\u548C\u6709\u95DC\u7269\u54C1 (\u4F8B\u5982\u706B\u5668, \u706B\u5668\u96F6\u4EF6\u548C\u5B50\u5F48\u76D2, \u5F48\u85E5, BB\u69CD\u548C\u5B50\u5F48, \u5439\u6DDA\u74E6\u65AF, \u6684\u6688\u69CD, \u5F48\u7C27\u5200, \u548C\u6B66\u8853\u6B66\u5668).</li></ul>',
