    'about.about_Body': '<p>OLX \u662F\u514D\u8CBB\u5206\u985E\u5EE3\u544A\u7684\u4E0B\u4E00\u4EE3.<br /><br />OLX \u70BA\u8CB7\u8CE3,\u4EA4\u6613,\u4EA4\u6D41,\u7D44\u7E54,\u4EE5\u53CA\u7121\u8AD6\u60A8\u4F4F\u5728\u4F55\u8655\u8207\u81E8\u8FD1\u7684\u4EBA\u898B\u9762\u4E4B\u5FA9\u96DC\u6027\u63D0\u4F9B\u7C21\u55AE\u7684\u89E3\u7B54.<br /><br />\u5728 OLX \u60A8\u53EF\u4EE5:<br /><ul><li>\u8F15\u6613\u5730\u8A2D\u8A08\u8C50\u5BCC\u6709\u8272\u5F69\u4EE5\u53CA\u542B\u6709\u5716\u7247\u548C\u5F71\u50CF\u7684\u5EE3\u544A</li><li>\u5728\u6211\u7684OLX\u4E0A\u63A7\u5236\u60A8\u7684\u8CB7,\u8CE3,\u4EE5\u53CA\u60A8\u5728\u793E\u5340\u4E0A\u7684\u6D3B\u52D5</li><li>\u5728\u60A8\u7684\u793E\u4EA4\u7DB2\u8DEF(Facebook, Myspace, ...)\u4E0A\u986F\u793A\u60A8\u7684\u5EE3\u544A</li><li>\u901A\u904E\u60A8\u7684\u79FB\u52D5\u9032\u5165\u7DB2\u7AD9</li><li>\u7528\u60A8\u7576\u5730\u7684\u8A9E\u8A00\u770BOLX </li></ul><br />OLX \u88AB<<QTY_COUNTRIES>>\u500B\u570B\u5BB6\u4EE5<<QTY_LANGUAGES>> \u7A2E\u8A9E\u8A00\u4F7F\u7528. \u516C\u53F8\u4E8E2006\u5E74\u7684\u4E09\u6708\u6210\u7ACB,\u70BA\u79C1\u4EBA\u6301\u80A1\u516C\u53F8.</p>',
